import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <header className='header'>

                </header>
            </div>
            <style global jsx>{`
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                }

                *{
                    box-sizing: border-box;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }

                .header{
                    background: white;
                    display: flex;
                    flex-direction: row;
                    width: 100%;
                    height: 7%;
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
